        int min_product = nums[0];
        int res = nums[0];
        for (int i = 1; i < nums.size(); ++i) {
            int cur_max = max(max(max_product * nums[i], min_product * nums[i]), nums[i]);
            int cur_min = min(min(max_product * nums[i], min_product * nums[i]), nums[i]);
            res = max(res, cur_max);
            max_product = cur_max;
            min_product = cur_min;
