class Solution {
public:
    int maxRotateFunction(vector<int>& A) {
        int sum = 0;
        int f0 = 0;
        for (int i = 0; i < A.size(); i++) {
            sum += A[i];
            f0 += i * A[i];
        }
        int max = f0;
        for (int i = 1; i < A.size(); i++) {
            f0 = f0 + sum - A.size() * A[A.size() - i];
            if (f0 > max) {
                max = f0;
            }
        }
        return max;
    }
};

